import React from 'react'
import { useRef } from 'react';
import {FaBars, FaTimes } from "react-icons/fa";

function Navbar() {

    
  return (
    <header>
        <h1>Carrot</h1>
        <nav>
            <a href='/#'>Product</a>
            <a href='/#'>Our Why</a>
            <a href='/#'>About Us</a>
            <a href='/#'>Contact Us</a>
            <button>
                <FaTimes/>
            </button>
        </nav>
        <button>
            <FaBars />
        </button>
    </header>
  );
}

export default Navbar
